import React from 'react';

// LecturerClassesView - Giao diện lecturerclasses cho admin (View trong MVC)
const LecturerClassesView: React.FC = () => {
  return (
    <div className="max-w-6xl mx-auto">
      <div className="mb-6">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Classes</h1>
        <p className="text-gray-600">Manage your assigned classes and course materials</p>
      </div>

      <div className="card">
        <div className="text-center py-12">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Class Management</h3>
          <p className="text-gray-600">This page will show your assigned classes with options to manage Tests, Grades, Materials, and Class Details.</p>
        </div>
      </div>
    </div>
  );
};

export default LecturerClassesView;
